import React from 'react';
import styles from './FieldSet.module.scss';
const FieldSet = () =>{
    return(
        <div className={styles['field-set']}>
            <fieldset>
                <legend className={styles.legend}>Title</legend>
            </fieldset>
            <input/>
        </div>
    )
}

export default FieldSet;
